#include <bits/stdc++.h>
 
using namespace std;
int canCompleteCircuit(vector<int>& gas, vector<int>& cost) {
     int len=gas.size();
    int tank=0,total_gas=0, total_cost=0, index=0;

    for (int i = 0; i < len; i++)
    {  
        total_gas+=gas[i];
        total_cost+=cost[i];
        tank=tank + gas[i] - cost[i];
        if (tank <0)
        {
            index=i+1;
            tank=0;
        }     
} 
 return (total_gas>=total_cost) ? index : -1; 
}
